// Solution 2:
const moveBall = arr => {
    const lastIndexOfNonDot = arr.lastIndexOf('.');
    if (lastIndexOfNonDot <= 0) return arr;
    for (let i = arr.length - 1; i >= 0; i--) {
        if (arr[i] === '.') {
            arr[i] = arr[lastIndexOfNonDot];
            arr[lastIndexOfNonDot] = '.';
            lastIndexOfNonDot--;
        }
    }
    return arr;
};
